Address associated with the access method.
The data present depends on the Access Method field value The area’s format can be described by the following 1-byte-packed "C" union:
union 
{ 
	struct 
	{ 
		short IndexAddr; 
		short DataAddr; 
	} IO;
	long PhysicalAddr32; 
	short GPNVHandle;  
} AccessMethodAddress;

Handle, or instance number, associated with any error that was previously detected for the array
If the system does not provide the error information structure, the field contains 0xfffe; 
otherwise, the field contains either 0xffff (if no error was detected) or the handle of the error-information structure.

BCD value of the month on which the next scheduled power-on is to occur, in the range 0x01 to 0x12;
The DMTF System Power Controls group contains a Next Scheduled Power-on Time, specified as the number of seconds until the next scheduled power-on of the system. Management software uses the date and time information specified in the associated SMBIOS structure to calculate the total number of seconds.
Any date or time field in the structure whose value is outside of the field’s specified range does not contribute to the total-seconds count. For example, if the Month field contains the value 0xFF the next power-on is scheduled to fall within the next month, perhaps on a specific day-of-month and time.
